import React from "react";
import styles from './Button.module.scss'
import classnames from "classnames/bind";

const cx = classnames.bind(styles);

function Button({children, primary}) {
    let Comp = 'button';
    const css = cx('button', {
        primary
    })
    return (
        <Comp className={css}>
            {children}</Comp>
    )
}

export default Button;
